import React from 'react';

const Forecast = (props) => {
    let temp = props.current.temp_c;
    let uv = props.current.uv;
    let precip = props.current.precip_in;
    let humidity = props.current.humity;
    let icon = props.current.condition.icon;
    let city = props.location.name;    

    return (
        <div>
            <h1>Current Weather for: ${city}</h1>

            <p>Temperature: ${temp}</p>
            <p><img src={icon}  /></p>
            <p>UV Index: ${uv}</p>
            <p>Humidity: ${humidity}</p>
            <p>Precipitation: ${precip}</p>

        </div>

    );

    };

export default Forecast;
